import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Redirect } from 'react-router-dom'
import Routes from '../../src/components/Routes';
import TopNavigation from './../components/topNavigation';
import SideNavigation from './../components/sideNavigation';
import Edit from './editProfil';
// import Article from './article';
// import MonProfil from './monProfil.jsx';
// import Footer from './../components/Footer';
import './../index.css'

class MonProfil extends React.Component {
    constructor(props) {
        super(props);
        this.renderRedirect = this.renderRedirect.bind(this)
        this.listeArticle = this.listeArticle.bind(this)
    }

    renderRedirect = () => {
        if (localStorage.getItem('login') == 'false') {
            return <Redirect to='/login' />
        } else {
            console.log('test');
        }

    }

    listeArticle = (e) => {
        const action = { type: "GETARTICLE", value: e }
        this.props.dispatch(action)
    }

    render() {
        return (
            <div>
                <div className="flexible-content">
                    {this.renderRedirect()}
                    <SideNavigation />
                    <TopNavigation />
                    <main id="content" className="p-5">
                        <div className="container fluid">
                            <Switch>
                                <Route path='/admin/monProfil/editProfil' component={Edit} />
                                {/* <Route path='/admin/monProfil' component={Article} />
                                <Route path='/admin/monProfil' component={MonProfil} />
                                <Route path='/protection' component={Article} /> */}
                            </Switch>
                        </div>
                    </main>
                    <Footer />
                </div>
            </div>
        )
    }
}

export default MonProfil;
